import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ViewMyPackages = ({ courierId }) => {
  const [packages, setPackages] = useState([]);

  useEffect(() => {
    const fetchPackages = async () => {
      try {
        const response = await axios.get(`http://localhost:8081/courier/${courierId}/packages`);
        setPackages(response.data);
      } catch (error) {
        console.error('Error fetching packages:', error);
      }
    };

    fetchPackages();
  }, [courierId]);

  return (
    <div>
      <h2>My Packages</h2>
      <ul>
        {packages.map((pkg) => (
          <li key={pkg.id}>
            {pkg.deliveryAddress} - {pkg.status}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ViewMyPackages;
